import React from "react";
import "./Pages.css";

const Terms = () => {
  return (
    <div className="page">
      <h2>Terms of Service</h2>
      <p>
        By using Blog App, you agree to follow our community guidelines and
        respect other users. Misuse may result in account suspension.
      </p>
    </div>
  );
};

export default Terms;
